  },
];

function App() {
  return (
    <div>
      {WorksImages.map((item) => (
        <WorkSlides
          name={item.workName}
          sculp={item.sculpture}
          text={item.text}
          paint={item.paint}
        />
      ))}
    </div>
  );
}
